/* eslint-disable @next/next/no-img-element */
import { ImageResponse } from "@vercel/og";
import { NextRequest } from "next/server";

export const config = {
	runtime: "edge",
};

export default function handler(req: NextRequest) {
	try {
		//  get searchParams
		const { searchParams } = new URL(req.url);

		// ?title=<title>
		const hasTitle = searchParams.has("title");

		// ?link=<title>
		const hasLink = searchParams.has("link");

		// ?discription=<title>
		const hasDescription = searchParams.has("discription");

		// add default title
		const title = hasTitle ? searchParams.get("title")?.slice(0, 100) : "Minimal blog";
		// add default title
		const link = hasLink ? searchParams.get("link") : "https://www.wadesplumbingandseptic.com/";
		// add default title
		const discription = hasDescription ? searchParams.get("discription")?.slice(0, 200) + "..." : "this is a discription to see how this works im not sure if its above 100 letters" + "...";

		return new ImageResponse(
			(
				<div tw="flex flex-col bg-black h-full w-full">
					<div tw="flex flex-col p-4 align-center">
						<img
							tw="absolute top-25 left-25"
							alt="Vercel"
							height={100}
							width={100}
							src="data:image/png;base64,"
						/>
						<div tw="flex flex-col space-y-6 mt-60 left-25 absolute">
							<div tw="text-white text-[60px] w-[1000px]">{title}</div>
							<div tw="text-white text-base mt-2 w-[1000px]">{discription}</div>
						</div>
					</div>
					<div tw="text-white text-base absolute bottom-10 right-10">{link}</div>
				</div>
			),
			{
				width: 1200,
				height: 640,
			}
		);
	} catch (e: any) {
		console.log(`${e.message}`);
		return new Response(`Failed to generate the image`, {
			status: 500,
		});
	}
}
